// App.js or App.jsx
import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState<string[] | null>(null);

  const handleSearch = async () => {
    try {
      const response = await axios.post('http://localhost:3000/search', { query });
      console.log('Response from server:', response.data);
      if (!response.data.exists) {
        console.log('Data not found in Redis');
        setResults(null);
        return;
      }
      setResults(response.data.results);
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (

    <div className="min-h-screen flex items-center justify-center bg-gray-100">
      <div className="bg-white p-8 rounded shadow-md w-96 text-center">
        <h1 className="text-2xl font-semibold mb-4">Search Engine</h1>
        <div className="mx-auto mb-4 w-3/4">
          <input
            type="text"
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            className="border p-2 w-full"
          />
        </div>
        <div className="mx-auto mb-4 w-3/4 bg-red-500">
  <input
    type="text"
    value={query}
    onChange={(e) => setQuery(e.target.value)}
    className="border p-2 w-full"
  />
</div>
        <button
          onClick={handleSearch}
          className="bg-blue-500 text-white px-4 py-2 rounded"
        >
          Search
        </button>
        {results ? (
          <div className="mt-4">
            {results.map((result, index) => (
              <div key={index} className="mb-2">{result}</div>
            ))}
          </div>
        ) : (
          <p className="mt-4">No results available</p>
        )}
      </div>
    </div>
  );
}

export default App;
